    false,nt"url": null,nt"notes": "This annual narrative report for Squaw
    Creek National Wildlife Refuge summarizes refuge activities during the 1993 calendar
    year.  The report begins with a summary of the yearu2019s highlights and climatic
    conditions.   Land acquisition is also covered.  The report includes a planning
    section which discusses master plan, management plan, compliance with environmental
    and cultural mandates, research and investigations and other.  Refuge administration
    is outlined; information about personnel, other manpower programs, volunteer programs,
    funding, safety, technical assistance, and other items is given.  Habitat management
    is also covered.  Subjects include general, wetlands, croplands, grasslands, haying,
    fire management, pest control, FmHA, private lands.  The wildlife section of the
    report discusses wildlife diversity, endangered and/or threatened species, waterfowl,
    marsh and waterbirds, shorebirds, gulls, terns, and allied species, raptors, other
    migratory birds, games animals, other resident wildlife. The public uses of the
    refuge described in this report include general, outdoor classrooms - students,
    interpretive foot trails, interpretive tour routes, interpretive exhibits/demonstrations,
    other interpretive programs, hunting, wildlife observation, other wildlife oriented
    recreation, picnicking, law enforcement, cooperating associations.  The equipment
    and facilities section of the report provides information about rehabilitation,
    major maintenance, equipment utilization and replacement, communication systems,
    energy conservation, and other.  Items of interest are provided at the end.",nt"license_title":
